import Layout from "../../components/Layout";
import React from "react";
import "./loginStyle.scss";
import { Link } from "react-router-dom";


const Signin = () => {
  return (
    <Layout title="Connexion" description="This is the Cart page">
      <i class="fa fa-user-circle d-block mx-auto" aria-hidden="true"></i>
      <h3 className="d-block mx-auto m-text">Inscrption</h3>
      <input
        className=" d-block m-input mx-auto"
        placeholder="E-mail"
        type="e-mail"
      />
      <input
        className=" d-block m-input mx-auto"
        placeholder="*******"
        type="password"
      />
      <div className="m-div">
        <button type="button" className="btn m-button btn-outline-primary">
          Inscription
        </button>
      </div>
    </Layout>
  );
};
export default Signin;
